import Container from "react-bootstrap/Container";
import CardStyle from "./Card";

// Ejemplo de datos
const Datas = [
  { id: 1, name: "Producto 1", price: 28, image: "/imagen/1.jpeg" },
  { id: 2, name: "Producto 2", price: 35, image: "/images/product2.jpg" }
];

export const CardList = ({ Datas, Loading, setCartArticle }) => (
  <Container className="d-flex flex-wrap mt-3" style={{ justifyContent: 'center', alignItems: 'center' }}>
    {Loading ? (
      <div>Loading...</div>
    ) : (
      Datas.map(person => (
        <CardStyle key={person.id} person={person} setCartArticle={setCartArticle} />
      ))
    )}
  </Container>
);
